import React from 'react';
import {useDispatch, useSelector} from 'react-redux';
import './App.css';

function App() {
	const session = useSelector(state => state.session);
	console.log(session);
	return (
		<div className="App">
			<header className="App-header">
				{session.username}
				{session.email}
        Account Created on { }
			</header>
		</div>
	);
}

export default App;
